import React from 'react'

function Joke({setup, punchline}) {
  return (
    <div className='w-36 h-6 shadow-md flex flex-col justify-center m-10'>
        <h1 className='text-lg font-semibold text-black'>"{setup}"</h1>
        <h1 className='text-lg font-semibold text-black'>"{punchline}"</h1>
    </div>
  )
}

export default Joke
